import styled from "styled-components";
import { Link } from "react-router-dom";

const LoginContainer = styled.div``;

const LoginGNB = styled.h1``;

const LoginForm = styled.form``;
const LoginLabel = styled.label`
  font-size: 5rem;
`;
const LoginInput = styled.input`
  margin: 2rem;
`;
const LoginBTN = styled.button``;

function Login() {
  return (
    <div id="GlobalContainer">
      <LoginContainer className="container">
        <LoginGNB className="gnb">로그인</LoginGNB>
        <LoginForm className="form">
          <LoginLabel className="label">
            이메일
            <br />
            <LoginInput className="input" type="text" required />
          </LoginLabel>
          <LoginLabel className="label">
            비밀번호
            <br />
            <LoginInput className="input" type="password" required />
          </LoginLabel>
          <Link to={"/login"} type="submit">
            로그인
          </Link>
          <LoginBTN className="submit_btn" type="submit">
            로그인
          </LoginBTN>
        </LoginForm>
      </LoginContainer>
    </div>
  );
}

export default Login;
